INSERT INTO `genres` (`id`, `name`, `description`) VALUES
(1, 'Rock & Rool', 'Mas que un estilo musical, un estilo de vida, todo lo que debes saber, es que unos cuernos con los dedos es el saludo por excelencia.'),
(2, 'Blues', ' género musical vocal e instrumental, basado en la utilización de notas de blues y de un patrón repetitivo (suele tener doce u ocho compases). '),
(3, 'Dance', 'conjunto de géneros de música electrónica, como el house, trance, eurodance, italo-disco, drum and bass, el híbrido dance pop, entre otros.'),
(4, 'Disco', 'La música disco es un género de música de baile derivada del R&B (rhythm & blues) que mezcló elementos de géneros anteriores, como el funk y el soul, con toques latinos en muchos casos, y que se popularizó en las discotecas a finales de los setenta.'),
(5, 'Funk', 'nació entre mediados y finales de los años 1960 cuando músicos principalmente afroamericanos fusionaron soul, jazz, ritmos latinos (mambo, por ejemplo) y R&B dando lugar a una nueva forma musical rítmica y bailable. '),
(6, 'Hip hop', 'compuesto por un amplio conglomerado de formas artísticas, originadas dentro de una subcultura marginal en la casa del Roger Tejerina, el Sur del Bronx y Harlem, en la ciudad de Nueva York, entre jóvenes afroamericanos e hispanos durante la década de 1970'),
(7, 'Jazz', 'género musical nacido a finales del siglo XIX en Estados Unidos, que se expandió de forma global a lo largo de todo el siglo XX.'),
(8, 'New age', 'creado por diferentes estilos cuyo objetivo es crear inspiración artística, relajación y optimismo. Suele ser utilizada por los que practican yoga, masaje, meditación,1 y lectura como método para controlar el estrés2 o para crear una atmósfera pacífica en su casa o en otros entornos, y suele asociarse al ecologismo y a la espiritualidad New Age.1'),
(9, 'Pop', 'la música pop es muy ecléctica, tomando prestado a menudo elementos de otros estilos como el urban, dance, el rock, la música latina, el rhythm and blues o el folk'),
(10, 'Punk', 'el punk era una música muy simple y cruda, a veces descuidada: un tipo de rock sencillo, con melodías agresivas de duraciones cortas, sonidos de guitarras amplificadas poco controlados y ruidosos cargados de mucha distorsión, pocos arreglos e instrumentos y, por lo general, de compases y tiempos rápidos.'),
(11, 'Reggae', 'El reggae se caracteriza rítmicamente por un tipo de acentuación del off-beat, conocida como skank. Normalmente, el tiempo del reggae es más lento que el del ska y el rocksteady['),
(12, 'Rumba', 'De raíces africanas, la rumba cubana es considerada la madre de numerosos ritmos y bailes latinos, como la salsa y tiene derivaciones en diversos países de América Latina'),
(13, 'Urban', 'subgénero del R&B y del soul que estuvo en boga principalmente en los años 80 y 90.'),
(14, 'World music', 'universal o música global es un género musical contemporáneo creado a fin de integrar en un concepto amplio toda la música tradicional o folclórica, música popular, música étnica y otros géneros locales o característicos de algunas zonas o culturas del mundo en concreto que suelen ser de difícil categorización para el gran público.');

