INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(1, 'Mojinos a Eurovision', 'Es hora de que Europa conozca de primera mano la calidad del producto nacional español. Los Mojinos Escozios son un ejemplo da calidad musical, competencia técnica, saber hacer y buen humor que no pueden faltar en una autentica banda de Rock & Roll. Si tu también estas harto de enviar pseudo-artista triunfitos de medio palo, únete a nosotros. Somos legión! ', 16, 90, 33, , 0, NULL);
INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(2, 'Rolling Stones FanClub', '4 hombres, 1 grupo, una leyenda imperecedera de la música Rock del siglo XX. Este grupo tributa a una de las mejores bandas de todas las eras. Da igual tu edad. Si mayas el Rock & Roll, amas a los Rolling, y si amas a los Rolling, este es tu grupo!', 16, 90, 2, , 1, NULL);
INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(3, 'Locos por la corchea', 'La música no seria nada sin la corchea! Eso lo sabe cualquier artista que se precie medianamente. Este grupo reivindica la fuerza de la corchea y su hermana menor frente a la negra, o la aburrida y extensa blanca.', 16, 90, 2, , 0, NULL);
INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(4, 'Amantes del OST', 'Los videojuegos son produciones en ocasiones millonarias que poseen en su interior verdaderas obras de arte. Si alguna vez quisiste compartir tu pasión por ese tema que solo pudiste oir en un videojuego. Este es tu sitio.', 16, 90, 3, , 0, NULL);
INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(5, 'Essency Chill\'out', '¿Harto de esas tralladas y el constante bombardeo de graves de la música del siglo XXI? Entra con nostros a un nuevo esquema de concepto musical, donde el tempo es tranquilo y los waves armonizan la melodía.', 16, 90, 3, , 0, NULL);
INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(6, 'Jazz Night', 'A medianoche las mentes se llenan de Jazz a la par que su cenicero o hace de colillas. El espiritu libre y melancólico que marco el mundo de la música abre sus puertas en este grupo.', 16, 90, 1, , 0, NULL);
INSERT INTO `groups` (`id`, `name`, `description`, `minAge`, `maxAge`, `numVisitas`, `img`, `numMiembros`, `estilo`) VALUES
(7, 'In Da House', 'El ritmo y la pasión de las mezclas digitales hace su entrada en Zone Music. La exlectrónica merece un estudio segmentado a parte. Si te hernian aquellos que llaman a esta revolución \"chunda-chunda\", eres de los nuestros!!', 16, 90, 2, , 0, NULL);
